import React from "react";
import { LockClosedIcon } from "@radix-ui/react-icons";
const Login = () => {
  return (
    <div>
      <p className="common-page" class="w-full h-full bg-primary">
        <LockClosedIcon /> Login 페이지 입니다.
      </p>
    </div>
  );
};

export default Login;
